  //Reverse a string using a JavaScript stack
  function reverse(text) {
    //loop in string
    let stack = []
    for (let i = 0; i < text.length; i++) {
      stack.push(text[i])
    }
    //reverse string
    let reverseText = ""
    while(stack.length > 0){
      reverseText += stack.pop()
    }
    return reverseText
  }
  console.log("reverse => " ,reverse("hamdy"))
